function Add(a ,b){
    let sum = a + b; 
    return sum;
}
function Sub(a ,b){
    let sum = a + b; 
    return sum;
}
function Mul(a ,b){
    let sum = a + b; 
    return sum;
}
function Div(a ,b){
    let sum = a + b; 
    return sum;
}
export default Add;
export {Sub ,Mul ,Div}
